var props = app.pages.SheetValues.properties;

function getSheetValues(){
  google.script.run.withSuccessHandler(function getValues(values){props.SheetValues = values;}).getSheetValues();
}



function getFirstValue(){

  google.script.run.withSuccessHandler(function getFirstValue(thisValue){props.FirstValue = thisValue;}).getFirstValue();

}

